import React, { useState } from 'react';
import { Button, Drawer } from 'antd';
import './Popup.css'
import { Input } from "@material-ui/core";
import {Link} from 'react-router-dom'


const Hamburger = (props) => {

    const [open, setOpen] = useState(false);
  return (
    <>
      <Drawer className='contact-drawer' placement="right" onClose={props.onClose} open={props.open}>
        <div>
            <ul className='Mobile Router'>
                <li className="Home"><Link to='/'>Home</Link></li>
                <li className="Projects"><Link to='/Projects'>Projects</Link></li>
                <li className="About"><Link to='/About'>About</Link></li>
                <li className="Contact"><button className='ButtonContact' onClick={() => setOpen(true)}> Contact</button></li>
            </ul>
        </div>
      </Drawer>
    </>
  );
};
export default Hamburger;
